#!/usr/bin/env bash
DIR="$( cd "$( dirname "${BASH_SOURCE[0]}" )" >/dev/null && pwd )"
$DIR/bspi.py "$@"
bspc subscribe all | while read -r line; do
    case $line in
      node_add*|node_remove*|node_transfer*|node_swap*|desktop_layout*)
            $DIR/bspi.py "$@"
            ;;
        *)
        ;;
    esac
done
EOF
